import * as React from 'react';
import Button from '@material-ui/core/Button';
import Avatar from '@material-ui/core/Avatar';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemAvatar from '@material-ui/core/ListItemAvatar';
import ListItemText from '@material-ui/core/ListItemText';
import DialogTitle from '@material-ui/core/DialogTitle';
import Dialog from '@material-ui/core/Dialog';
import PersonIcon from '@material-ui/icons/Person';
import AddIcon from '@material-ui/icons/Add';
import Typography from '@material-ui/core/Typography';
import { blue } from '@material-ui/core/colors';

import TextField from '@material-ui/core/TextField';

import AddCircleIcon from '@material-ui/icons/AddCircle';
import SelectList from './SelectList'
import DialogActions from '@material-ui/core/DialogActions';

const emails = ['username@gmail.com', 'user02@gmail.com'];

import IDialogAddOrderItem from '../Data/Dialog/IDialogAddOrderItem'

export interface SimpleDialogProps {
  open: boolean;
  selectedValue: IDialogAddOrderItem;
  onClose: (value: IDialogAddOrderItem) => void;
}




function SimpleDialog(props: SimpleDialogProps) {
  const { onClose, selectedValue, open } = props;

  const handleClose = () => {
    onClose(selectedValue);
  };

  const handleListItemClick = (value: IDialogAddOrderItem) => {
    onClose(value);
  };

  return (
    <Dialog onClose={handleClose} open={open}>
      <DialogTitle>Добавить продукт</DialogTitle>
        <SelectList
        data={selectedValue}
        onClose={handleClose}
        />
      <DialogActions>
          <Button onClick={handleClose}>Disagree</Button>
          <Button onClick={handleClose} autoFocus>
            Agree
          </Button>
        </DialogActions>
    </Dialog>
  );
}

export default function DialogAddOrderItem() {
  const [open, setOpen] = React.useState(false);
  const [selectedValue, setSelectedValue] = React.useState(emails[1]);

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = (value: string) => {
    setOpen(false);
    setSelectedValue(value);
  };

  return (
    <div style={{width: '100%'}}>
      <Button 
      onClick={handleClickOpen}
      style={{width: '100%',display:'flext', justifyContent: 'space-around'}}
      variant="contained" endIcon={<AddCircleIcon />}>
        Добавить заказ
      </Button>

      <SimpleDialog
        selectedValue={selectedValue}
        open={open}
        onClose={handleClose}
      />
    </div>
  );
}

